import './App.css';
import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import { BrowserView, MobileView } from 'react-device-detect';
import MobileHeader from './containers/mobile/Header';
import DesktopHeader from './containers/desktop/Header';

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/" exact>
            <BrowserView>
              <DesktopHeader />
            </BrowserView>
            <MobileView>
              <MobileHeader />
            </MobileView>
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
